css:
@-moz-document domain("pingpong.uu.se") {
#container {background: #353030 !important;}
#body,#fullWidthNav {background: #353030 !important; color: #AEB2F8 !important;}
#logotype {box-sizing: border-box;padding-left: 180px;position: relative !important; top: 5px !important;left:25px !important;}
#logotype {background: url('data:image/gif;base64,') !important; background-repeat: no-repeat !important;}
#header-shortcuts ul li a {color: #D03C3C !important;}
#header-shortcuts ul li a:hover{color:#338400 !important}
#nav .nav-top-item .nav-top-item-link {color: #c12f1d !important;font-weight: bold !important;font-size: 15px;text-shadow: 2px 0px 3px #000 !important;-webkit-text-stroke-width: 0.01px;-webkit-text-stroke-color: #000;}
.list-attachments {background: #353030 !important;border: 1px solid #ccc !important;}
input {background: #353030 !important;color: #AEB2F8 !important;}
li div span span.dynamic-data {color: #c12f1d !important}
a span span.dynamic-data {color:#66A968 !important;}
a span span.dynamic-data:hover {color:#338400 !important;}
.nav-sub-item a:hover{font-weight: bold !important;text-shadow: 2px 0px 2px #000 !important;}
.action-section {background: #353030 !important; color: #8F938F !important;}
#bread-crumbs {background: #353030 !important; color: #D03C3C !important;}
.bread-crumb-item {background: #353030 !important; color: #8F938F !important;}
.icon-new-old {opacity: 0.3;}
.nav-sub, .nav-sub-item {background: #353030 !important;}
.chosen-drop,.chosen-results {background: #353030 !important;color: #DE8E30 !important}
.box {background: #353030 !important; color: #8F938F !important;border: 1px solid rgba(255,255,255,0.25);}
h2,h1,h4,h3,h2 span {background: #353030 !important; color: #DE8E30 !important;font-weight: bold !important;}
p + h2{ color: #DE8E30 !important;}
p span {background: #353030 !important;}
.viktigt:first-of-type {border-top: 3px ridge #ccc !important;padding-top: 13px !important;}
.viktigt {background: #353030 !important;border-bottom: 0px solid black !important;border-left: 3px ridge #ccc !important; border-right: 3px ridge #ccc !important;color:#ED0A4F !important;}
.viktigt + .viktigt {background: #353030 !important;border-top: 0px solid black !important;border-bottom: 0px ridge #ccc !important;padding-bottom: 13px;}
.viktigt:last-of-type {border-bottom: 3px ridge #ccc !important;padding-bottom: 13px;}
.kapitel {color: #8F938F !important;font-style:italic !important;}
.begrepp {color: #AEB2F8 !important; font-size: 1.05em;}
.variabel {color:#686ff2 !important; font-weight:bold !important;}
.engelska {color:#ffff66 !important; font-weight:bold !important;}
li b span {background: #353030 !important;}
.rsBox {background: #353030 !important; }
textarea {background: #353030 !important; color: #AEB2F8 !important;border-color: #ccc !important;}
p>span,span>span {color: #AEB2F8 ;}
.a-block li a {background: #353030 !important; color: #D03C3C !important;}
.a-block li a:hover {color:#338400 !important}
.link-button,.chosen-single {background: #353030 !important;text-shadow: 0px 0px #338400 !important}
#PPDcontentBody,#discussForums_tableContainer,.page-iterator,.clearfix,.page-content, .two-column-content,th,td,#discussSubjects_tableContainer,#discussSubjects,.data-row,#content-frame-wrapper,ppfdata,body {background: #353030 !important; color: #AEB2F8 !important;}
head + body{overflow: visible !important;}
.rte-nav{border-bottom: 0px !important;}
pre {background: #353030 !important; color: #AEB2F8 !important;border: 1px solid rgba(255,255,255,1);}
.select {background: #353030 !important; color: #AEB2F8 !important;}
#critera  {background: #353030 !important;}
.entry,.roleStudent,.ppContent,.ppCorrectOrderItem {background: #353030 !important;}
.multipleChoiceQuestion{border:2px solid #ccc !important;}
.button  {background: #353030 !important;color:#66A968 !important;text-shadow: 0px 0px #338400 !important}
.textfield,.ac--selected-items,.ac--items {background: #353030 !important;color:#AEB2F8 !important;}
#scrollArea {background: #353030 !important;color:#AEB2F8 !important;}
.tab.activeTab {background: darkslategray !important; text-shadow: 1px 0px 4px #000 !important;-webkit-text-stroke-width: 0.001px;-webkit-text-stroke-color: #000;}
.tab.activeTab a {color: #c12f1d !important;}
.tab.activeTab a:hover {color: #c12f1d !important;}
.tab {background: #4D8282 !important; }
.tab a {color: #712f1d !important;}
.tab a:hover {color: #336400 !important;}
.table-tag-wrapper {background: #353030 !important;}
.tabPageContainer, .calendarPageContainer {background: #353030 !important;}
a {color: #66A968 !important;}
a:hover {color: #338400 !important;}

}
